function setNamaazTime(month, day, imsaak, fajr, sunrise, zohr, sunset, maghrib) {
  var current_date = new Date();
  var months = ["Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul", "Aug", "Sep", "Oct", "Nov", "Dec"];
  var next_namaaz = "fajr";
  var date_str = "" + current_date.getFullYear() + "-" + month + "-" + day;
  var the_date = new Date(current_date.getFullYear(), month, day, imsaak.substr(0,2), imsaak.substr(3, 2), 0, 0);
  the_date.setUTCHours(imsaak.substr(0,2));
  imsaak = "" + the_date.getHours() + imsaak.substr(2);
  if (the_date.getHours() < 10) imsaak = "0" + imsaak;
  the_date.setUTCHours(fajr.substr(0,2));
  fajr = "" + the_date.getHours() + fajr.substr(2);
  if (the_date.getHours() < 10) fajr = "0" + fajr;
  the_date.setUTCHours(sunrise.substr(0,2));
  sunrise = "" + the_date.getHours() + sunrise.substr(2);
  if (the_date.getHours() < 10) sunrise = "0" + sunrise;
  the_date.setUTCHours(zohr.substr(0,2));
  zohr = "" + the_date.getHours() + zohr.substr(2);
  the_date.setUTCHours(sunset.substr(0,2));
  sunset = "" + the_date.getHours() + sunset.substr(2);
  the_date.setUTCHours(maghrib.substr(0,2));
  maghrib = "" + the_date.getHours() + maghrib.substr(2);
  if (current_date.getDate() == day && current_date.getMonth()+1 == month) {
    $('#today_imsaak').append(imsaak);
    $('#today_fajr').append(fajr);
    $('#today_sunrise').append(sunrise);
    $('#today_zohr').append(zohr);
    $('#today_sunset').append(sunset);
    $('#today_maghrib').append(maghrib);
    $('#label_date').append("" + current_date.getDate() + " " + months[current_date.getMonth()] + " " + current_date.getFullYear()); 
    // check which namaaz is next!
    var fajr_date = new Date(current_date.getTime());
    fajr_date.setHours(fajr.substr(0,2));
    fajr_date.setMinutes(fajr.substr(3,2));
    var zohr_date = new Date(current_date.getTime());
    zohr_date.setHours(zohr.substr(0,2));
    zohr_date.setMinutes(zohr.substr(3,2));
    var maghrib_date = new Date(current_date.getTime());
    maghrib_date.setHours(maghrib.substr(0,2));
    maghrib_date.setMinutes(maghrib.substr(3,2));
    if (current_date < fajr_date) {
       $('#today_fajr').addClass('nextnamaaz');
       $('#label_fajr').addClass('nextnamaaz');
    }
    else if (current_date < zohr_date) {
       $('#today_zohr').addClass('nextnamaaz');
       $('#label_zohr').addClass('nextnamaaz');
    }
    else if (current_date < maghrib_date) {       
       $('#today_maghrib').addClass('nextnamaaz');
       $('#label_maghrib').addClass('nextnamaaz');
    }
    else {
       $('#today_fajr').addClass('nextnamaaz');
       $('#label_fajr').addClass('nextnamaaz');
    }
  }
};

function insert_namaaztimes() {
  var now = new Date();
  var prayers = prayer_times[now.getMonth()][now.getDate()];
  setNamaazTime(now.getMonth() + 1, now.getDate(), prayers["imsaak"], prayers["fajr"], prayers["sunrise"], prayers["zohr"], prayers["sunset"], prayers["maghrib"]); 
};
